// 	Module:				_engine.ts
// 	Description:		Engine recognition heuristics.
// 	Also-see:
// 	Tab-stops:			4
// 	Language:			ts
//  Creation Date:  07/16/2018
// 	Description:
// 	Revisions:
//  Author:    Doug/Jag
// 	Precompiled regular expressions.
//
const reZeroCylinder =		/\b(0 CYLINDER|00 CYLINDER|0 CYL|0.0L)\b/i;
const reCylinders = 		/\d{1,2}( |-|)CY(L|I)|\d{1,2}( |-|)CLY|\d{1,2}( |-|)YL.|\d{1,2}CY\b|\d{1,2}CYD|\d{1,2}CYCLIN/i;
const reCylinderText =		/(one( |-)cyl|two( |-)cyl|three( |-)cyl|four( |-)cyl|five( |-)cyl|six( |-)cyl|eight( |-)cyl|ten( |-)cyl|twelve( |-)cyl)/i;
const reInlineWord =		/\b(I-\d{1,2}|I\d{1,2}|I \d{1,2})\b/i;
const reVWord =				/\b(V-\d{1,2}|V\d{1,2}|V \d{1,2})\b/i;
const re32Valve =			/(32v|32-v|32 v)/i;
const re24Valve =			/(24v|24-v|24 v)/i;
const re16Valve =			/(16v|16-v|16 v)/i;
const reDisplacement =		/(\b\d{1,2}\.\d{1,2}( |-|)(L|T)|\b\d{1,2}(L|T)|\b\d{1,2}( |-|)(L|T)|\b\d{1,2}\.\d{1,2}\b)/i;
const reRotary =			/(rotary|rotor|1.3L MPI|1.3L R MPI)/i;
const reOther =				/(\d+( |-)cc|\d+cc|(2|4|two|four)stroke|(2|4|two|four)( |-)stroke|fuel cell|in( |)board|out( |)board|yamah|mercrui|mercur|hydrogen)/i;
const reElectric =			/(electric|elec|\bev\b|induction|voltec|magnet|plug-in)/i;
const reTurbo =				/(turb|\btsi\b|ecoboost|\b\d{1,2}\.\d{1,2}( |-|)T|\b\d{1,2}T|\b\d{1,2}( |-|)T)/i;
const reDiesel =			/(dies|deis)/i;
const reFlex =				/(flex|ethan|biofuel|\be85\b)/i;
const reNaturalGas =		/(natural gas|nat gas)/i;
const reGas =				/gas/i;
const reHybrid =			/\b(hy|hyb|hybr|hybri|hybrid)\b/i;
//
const reStripNonNumerics =	/\D/g;

// 	MapEngine uses a set of heuristics to match a wide variety of engine types
// 		into the canonical format specified by the product team.
// 		Arguments:
// sInput: the Classic 'Engine_Name' field value.
// 		Outputs:
// string: canonical engine description (e.g., '4 CYLINDER TURBO DIESEL')
//
export function MapEngine(sInput: string) {
    //
    let bDiesel = 		false;
    let bElectric =		false;
    let bFlex =			false;
    let bHybrid =		false;
    let bNaturalGas =	false;
    let bOther =		false;
    let bRotary =		false;
    let bTurbo =		false;
    let nCylinders =	-1;
    //
    //
    do {

        // Look for CC, 2-stroke, etc. to mark as 'OTHER'.
        //
        if (reOther.test(sInput)) {
            bOther = true;
            break;
        }

        // 	Is it a rotary engine?
        //
        if (reRotary.test(sInput)) {
            bRotary = true;
            break;
        }

        // 	Natural gas?
        //
        if (reNaturalGas.test(sInput)) {
            bNaturalGas = true;
        }

        // 	Determine whether electric or electric hybrid.
        //
        if (reElectric.test(sInput)) {
            nCylinders = 0;
            if (reGas.test(sInput)) {
                bHybrid = true;
            } else {
                bElectric = true;
            }
        }

        // 	Turbo, diesel and flex-fuel are optional characteristics...
        //
        if (reTurbo.test(sInput)) {
            bTurbo = true;
        }
        if (reDiesel.test(sInput)) {
            bDiesel = true;
        }
        if (reFlex.test(sInput))  {
            bFlex = true;
        }
        if (reHybrid.test(sInput)) {
            bHybrid = true;
        }

        // Some engines have a bogus '0 CYLINDER' prefix. Cleanse it.
        //
        sInput = sInput.replace(reZeroCylinder, '');

        // 	Explicit cylinders?
        //
        if (reCylinders.test(sInput)) {
            let sTemp = sInput.match(reCylinders)[0];
            nCylinders = parseInt(sTemp.replace(reStripNonNumerics, ''));
            break;
        }

        // Cylinder text (e.g., 'six cylinders')?
        //
        if (reCylinderText.test(sInput)) {
            let sTemp = sInput.match(reCylinderText)[0];
            sTemp = sTemp.toLowerCase();
            let nCursor = sTemp.indexOf(' ');
            if (nCursor < 0) {
                nCursor = sTemp.indexOf('-');
            }
            if (nCursor > 0) {
                sTemp = sTemp.substr(0, nCursor);
            }
            switch (sTemp) {
                case 'one':		nCylinders = 1;  break;
                case 'two':		nCylinders = 2;  break;
                case 'three':	nCylinders = 3;  break;
                case 'four':	nCylinders = 4;  break;
                case 'five':	nCylinders = 5;  break;
                case 'six':		nCylinders = 6;  break;
                case 'eight':	nCylinders = 8;  break;
                case 'ten':		nCylinders = 10; break;
                case 'twelve':	nCylinders = 12; break;
                default : nCylinders = 4; break; // TODO what is the default?

            }
            break;
        }

        // 	Inline or V-configuration?
        //
        if (reInlineWord.test(sInput)) {
            let sTemp = sInput.match(reInlineWord)[0];
            nCylinders = parseInt(sTemp.replace(reStripNonNumerics, ''));
            break;
        }
        if (reVWord.test(sInput)) {
            let sTemp = sInput.match(reVWord)[0];
            nCylinders = parseInt(sTemp.replace(reStripNonNumerics, ''));
            break;
        }

        // 	4-valve-per-cylinder configuration?
        //
        if (re32Valve.test(sInput)) {
            nCylinders = 8;
            break;
        }
        if (re24Valve.test(sInput)) {
            nCylinders = 6;
            break;
        }
        if (re16Valve.test(sInput)) {
            nCylinders = 4;
            break;
        }

        // 	Finally, we guess number of cylinders based upon displacement.
        // 		Ranges provided by Brandi's SME.
        // 		Note that displacement above 34L indicates an electric motor.
        //
        if (reDisplacement.test(sInput)) {
            let fDisplacement = parseFloat(sInput.match(reDisplacement)[0]);
            if (fDisplacement === 0.0) {
                nCylinders = 0;
                break;
            }
            if (fDisplacement < 1.0) {
                nCylinders = 2;
                break;
            }
            if (fDisplacement < 1.5) {
                nCylinders = 3;
                break;
            }
            if (fDisplacement <= 2.6) {
                nCylinders = 4;
                break;
            }
            if (fDisplacement <= 3.6) {
                nCylinders = 6;
                break;
            }
            if (fDisplacement >= 34.0) {
                nCylinders = 0;
                break;
            }
            nCylinders = 8;
            break;
        }

        //
    } while (0);

    // 	Configure canonical result.
    //
    let sResult = '';
    if (bOther) {
        sResult += 'OTHER';
    } else if (bRotary) {
        sResult += 'ROTARY';
    } else if (bElectric  &&  nCylinders <= 0) {
        sResult += 'ELECTRIC';
    } else if (nCylinders <= 0) {
        sResult += 'UNKNOWN';
    } else {
        sResult += '' + nCylinders + ' CYLINDER';
        if (bDiesel) {
            sResult += ' DIESEL';
        }
        if (bFlex) {
            sResult += ' FLEX-FUEL';
        }
        if (bNaturalGas) {
            sResult += ' NATURAL GAS';
        }
        if (bElectric  ||  bHybrid) {
            sResult += ' GAS/ELECTRIC HYBRID';
        }
    }
    if (bTurbo) {
        sResult += ' TURBO';
    }
    return (sResult);
}

